document.getElementById('pdfdata').addEventListener('click',
  exportPDF);

var specialElementHandlers = {
  '.no-export': function(element, renderer) {
    return true;
  }
};
function exportPDF() {
  var doc = new jsPDF('p', 'pt', 'a4');
  var source = document.getElementById('getData').outerHTML;
  var margins = {
    top: 10,
    bottom: 10,
    left: 10,
    width: 595
  };
  doc.fromHTML(
    source,
    margins.left,
    margins.top, {
      'width': margins.width,
      'elementHandlers': specialElementHandlers
    },
    function(dispose) {
      doc.save('table.pdf');
    }, margins);
}
// ----------------------------------------------------------- //
function printData()
{
   var divToPrint=document.getElementById("getData");
   newWin= window.open("");
   newWin.document.write(divToPrint.outerHTML);
   newWin.print();
   newWin.close();
}
$('#btnprint').on('click',function(){printData();})
